import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Navbar from "./Components/Navbar";

function Sales() {

  const [salesdata, setsalesdata] = useState([]);

  useEffect(() => {
    axios
      .get('http://127.0.0.1:8000/project/sales/')
      .then((res) => setsalesdata(res.data));
  }, []);

  return (
    <>
      <h1>Sales Data</h1>
      <Navbar/>
      {salesdata.map((sales) => {
        const { sales_id, sales_date } = sales;
        return (
          <div key={sales_id}>
            <h2>{sales_id}</h2>
            <h2>{sales_date}</h2>
          </div>
        );
      })}
    </>
  );
}

export default Sales;
